// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";

contract Lottery is VRFConsumerBase, Ownable {
 address payable[] public players;
 address payable public recentWinner;
 uint256 public randomness;
 uint256 public usdEntryFee;
 AggregatorV3Interface internal ethUsdPriceFeed;
 enum LOTTERY_STATE {
  OPEN,
  CLOSED,
  CALCULATING_WINNER
 }

 LOTTERY_STATE public lottery_state;
 uint256 public fee;
 bytes32 public keyhash;
 event RequestedRandomness(bytes32 requestId);

 constructor(
  address _priceFeedAddress,
  address _vrfCoordinator,
  address _link,
  uint256 _fee,
  bytes32 _keyhash
 ) public VRFConsumerBase(_vrfCoordinator, _link) {
  usdEntryFee = 50 * (10**18);
  ethUsdPriceFeed = AggregatorV3Interface(_priceFeedAddress);
  lottery_state = LOTTERY_STATE.CLOSED;
  fee = _fee;
  keyhash = _keyhash;
 }

 function enter() public payable {
  // $50 minimum
  require(lottery_state == LOTTERY_STATE.OPEN);
  require(msg.value >= getEntranceFee(), "you do not have enough money");
  players.push(payable(msg.sender));
 }

 function getEntranceFee() public view returns (uint256) {
  (, int256 price, , , ) = ethUsdPriceFeed.latestRoundData();
  uint256 adjustedPrice = uint256(price) * 10**10; // 18 decimals
  uint256 costToEnter = (usdEntryFee * 10**18) / adjustedPrice;
  return costToEnter;
 }

 function startLottery() public onlyOwner {
  require(
   lottery_state == LOTTERY_STATE.CLOSED, "Can't start a new lottery yet"
  );
  lottery_state = LOTTERY_STATE.OPEN;
 }

 function endLottery() public onlyOwner {
  lottery_state = LOTTERY_STATE.CALCULATING_WINNER;
  bytes32 requestId = requestRandomness(keyhash, fee);
  emit RequestedRandomness(requestId);
 }

 function fulfillRandomness(bytes32 _requestId, uint256 _randomness) internal override 
 {
  require(
   lottery_state == LOTTERY_STATE.CALCULATING_WINNER, "You aren't yet !"
  );
  require(_randomness > 0, "random-not-found");
  uint256 indexOfWinner = _randomness % players.length;
  recentWinner = players[indexOfWinner];
  recentWinner.transfer(address(this).balance); // transfer coin to the winner
  // Reset
  players = new address payable[](0);
  lottery_state = LOTTERY_STATE.CLOSED;
  randomness = _randomness;
 }
}
